import React, {useState, useEffect} from 'react'
import axiosWithAuth from '../axiosWithAuth'
import {Route, Switch } from 'react-router-dom'
import OperatorDetails from './OperatorDetails'
import OperatorTrucks from './OperatorTrucks'
import PrivateRoute from '../PrivateRoute'

export default function OperatorDashboard() {
    const [operators, setOperators] = useState([])

    useEffect(()=>{
          axiosWithAuth().get('/api/ops')
          .then(res =>{
            console.log(res.data.users)
            setOperators(res.data.users)
          })
          .catch(err =>{ console.log(err, 'No data coming in!')})
    },[])
    




    return (
        <div>
        <PrivateRoute path='/Operator/Dashbaord/trucks/:id'  component={OperatorTrucks}/>
            <h1>Welcome to the Operator Dashboard</h1>
            <h2>Current Active Operators</h2>
            {operators.map(item =>{
                return(
                    <OperatorDetails
                    key={item.id}
                    id={item.id}
                    userName={item.username}
                    />
                )
            })}

        </div>
    )
}
